import React from "react";
import "../header/header.scss";
import { MdKeyboardArrowRight } from "react-icons/md";

const header = () => {
  return (
    <div>
      <p class="title title-styles">
        <span class="title-name-styles">:</span>
        <span class="title-name-styles-underlined">rita</span>
        <span class="title-name-styles">:</span> product designer and frontend
        developer
      </p>
      <p class="subtitle">
        <span class="subtitle-icon">
          <MdKeyboardArrowRight size={48} />
        </span>
        Currently working at the Open Academic Environment open source project.
        <br />
        <span class="header-break"> Freelancing for UESP. </span>
      </p>
    </div>
  );
};

export default header;
